        'Security Off -> No filtering of inbound or outbound traffic.        \nLow Security -> Inbound traffic is blocked based on the settings under \'Service Blocking\'. Outbound traffic is not blocked.        \nMedium Security -> Inbound traffic is blocked based on the settings under \'Service Blocking\'. Outbound traffic is not blocked. There is more inbound traffic blocked when compared to \'Low Security\'.        \nHigh Security -> Inbound traffic is blocked based on the settings under \'Service Blocking\'. Outbound traffic is blocked based on the settings under \'Service Blocking\' including DNS.': 'Sicherheit deaktiviert -> keine Filterung eingehenden oder ausgehenden Datenverkehrs.        \nNiedrige Sicherheit -> Eingehender Datenverkehr wird gemäß den Einstellungen unter \„Dienstblockierung\“ blockiert. Ausgehender Datenverkehr wird nicht blockiert.        \nMittlere Sicherheit -> Eingehender Datenverkehr wird gemäß den Einstellungen unter \„Dienstblockierung\“ blockiert. Ausgehender Datenverkehr wird nicht blockiert. Es wird im Vergleich zu \„Niedrige Sicherheit\“ mehr eingehender Datenverkehr blockiert.        \nHohe Sicherheit -> Eingehender Datenverkehr wird gemäß den Einstellungen unter \„Dienstblockierung\“ blockiert. Ausgehender Datenverkehr wird gemäß den Einstellungen unter \„Dienstblockierung\“, einschließlich DNS, blockiert.',
